import { Circle } from './styles/LoadingStyle'
const Loading = () => {
    return (
        <Circle  xmlns="http://www.w3.org/2000/svg">
            <circle cy="70" cx="70" r="1"></circle>
        </Circle>

    )
}

export default Loading
